
DROP TABLE IF EXISTS "dublin_industrial_warehouse_buildings" CASCADE;

CREATE TABLE "dublin_industrial_warehouse_buildings" ( "pkid" SERIAL not NULL PRIMARY KEY,
  "wkb_geometry" geometry,
  "id" VARCHAR(254),
  "building" VARCHAR(254),
  "type" VARCHAR(254),
  "name" VARCHAR(254),
  "amenity" VARCHAR(254)
 );

CREATE INDEX "dublin_industrial_warehouse_buildings_wkb_geometry_geom_idx" ON "dublin_industrial_warehouse_buildings" USING GIST ("wkb_geometry");



alter table dublin_industrial_warehouse_buildings drop column if exists amenity;
alter table dublin_industrial_warehouse_buildings drop column if exists type;
alter table dublin_industrial_warehouse_buildings drop column if exists name;
alter table dublin_industrial_warehouse_buildings add column yelp_postc VARCHAR(50);
alter table dublin_industrial_warehouse_buildings add column distance_to_hospital real default 0.0;
alter table dublin_industrial_warehouse_buildings add column distance_to_fire_station real default 0.0;
